import React, { Component } from 'react';
import { Route, Switch, withRouter, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import ListData from './ListData/index';
import PostData from './PostData/index';
import EditData from './EditData/index';
import { ProtectedRoute } from '../../routes/ProtectedRoute';

class DataComponent extends Component {
    render() {
        return (
            <div className="dashboard-content-container">
                <Switch>
                    {/* <Route exact path="/api/list-data" component={ListData} />
                    <Route path="/api/list-data" component={ListData} />
                    <Route path='/demo/abc' component={PostData} />
                    <Route path="/api/edit-data" component={EditData} /> */}
                    <Route exact path="/form">
                        <Redirect to={'/form/GetData'} />
                    </Route>
                    <Route path="/form/GetData" component={ListData} />
                    <ProtectedRoute path='/form/AddData' component={PostData} />
                    <Route path="/form/PutData/:id" render={props => (<EditData {...props} />)}></Route>

                    {/* 
                    <Route exact path="/layout">
                        <Redirect to={'/layout/dashboard'} />
                    </Route>
                    <Route exact path="/layout/dashboard" component={Dashboard} />
                    <Route exact path="/layout/integration" component={Integration} /> */}

                </Switch>
            </div>
        )
    }
}
function mapStateToProps(state) {
    const { toggleStatus } = state.appReducer;
    const { auth } = state.LoginReducer;
    return { toggleStatus, auth }
}

export default withRouter(connect(mapStateToProps)(DataComponent));
